(45, 29, 300, 'Marc', 'James', 'Germany', NULL, 'Dortmund', 'Kleppingstraße 8, 44135 Dortmund, Germany', '<div><span style=\"color:rgb(0,0,0);font-family:Outfit, sans-serif, sans-serif;font-size:18px;font-style:normal;font-weight:200;\">Colleen’s top priority is to listen to you, evaluate your needs and establish a relationship with you based on trust, honesty, and integrity. Once you have established mutual goals, she will market your property utilizing sound planning techniques developed from years of training and professional experience, professional ethics, persuasive skills, and a strong company support system. During the entire process she will assist you in negotiations and keep you informed and protected. She strives to deliver more value to you than you expect to receive and to provide uncompromising service based on truth, fairness, knowledge, professionalism, and enthusiasm.</span></div>', NULL, '2025-04-08 00:27:43', '2025-04-25 23:59:29'),
(46, 29, 301, 'Marc', 'James', 'Germany', NULL, 'Dortmund', 'Kleppingstraße 8, 44135 Dortmund, Germany', '<div>أولوية كولين القصوى هي الاستماع إليك، وتقييم احتياجاتك، وبناء علاقة معك قائمة على الثقة والصدق والنزاهة. بمجرد تحديد أهدافكما المشتركة، ستسوّق لك عقارك باستخدام أساليب تخطيط سليمة اكتسبتها من سنوات من التدريب والخبرة المهنية، وأخلاقيات المهنة، ومهارات الإقناع، ونظام دعم قوي للشركة. خلال العملية بأكملها، ستساعدك في المفاوضات وتُبقيك على اطلاع دائم وتحميك. تسعى جاهدةً لتقديم قيمة أكبر مما تتوقع، وتقديم خدمة لا تقبل المساومة، قائمة على الصدق والإنصاف والمعرفة والاحترافية والحماس.</div>', NULL, '2025-04-08 00:27:43', '2025-04-25 23:59:29'),
