(51, 32, 302, 'Marcia', 'R. Worth', 'USA', 'Miami', 'Homestead', 'Main Street Homestead, FL 33030', '<p><span style=\"color:rgb(141,141,141);font-family:Montserrat, sans-serif;font-size:16px;font-style:normal;font-weight:500;background-color:rgb(255,255,255);\">Born and raised in Northern Germany, Tinka\'s quest for white sand and sunshine led her to Southern Florida more than 21 years ago. Here she successfully led an international marketing and consulting firm before entering the real estate industry. Her in- depth knowledge of the local area, combined with her keen sense of marketing and sales make her the ideal agent to assist you with your real estate needs. Tinka is a highly successful, professional and reliable agent. She prides herself in excellent communication and negotiation skills. As an avid boater and water enthusiast, Tinka specializes in waterfront and coastal single-family homes, condos, townhouses and investment properties in Lighthouse Point, Boca Raton, Pompano Beach, Highland Beach, Delray Beach and Deerfield Beach. Tinka is an Ellie Platinum Award recipient (Top 3% company wide) and top 1.5% nationwide, real trends, Executive Director of Luxury Sales at the Boca Raton office</span></p>', NULL, '2025-04-13 19:55:58', '2025-04-14 02:39:00'),
(52, 32, 303, 'Marcia', 'R. Worth', 'USA', 'Miami', 'Homestead', 'Main Street Homestead, FL 33030', '<p><span style=\"color:rgb(141,141,141);font-family:Montserrat, sans-serif;font-size:16px;font-style:normal;font-weight:500;background-color:rgb(255,255,255);\">Born and raised in Northern Germany, Tinka\'s quest for white sand and sunshine led her to Southern Florida more than 21 years ago. Here she successfully led an international marketing and consulting firm before entering the real estate industry. Her in- depth knowledge of the local area, combined with her keen sense of marketing and sales make her the ideal agent to assist you with your real estate needs. Tinka is a highly successful, professional and reliable agent. She prides herself in excellent communication and negotiation skills. As an avid boater and water enthusiast, Tinka specializes in waterfront and coastal single-family homes, condos, townhouses and investment properties in Lighthouse Point, Boca Raton, Pompano Beach, Highland Beach, Delray Beach and Deerfield Beach. Tinka is an Ellie Platinum Award recipient (Top 3% company wide) and top 1.5% nationwide, real trends, Executive Director of Luxury Sales at the Boca Raton office</span></p>', NULL, '2025-04-13 19:55:58', '2025-04-14 02:39:00'),
(53, 33, 302, 'Oscar', 'Eade', 'USA', 'Texas', 'San Antonio', '123 Alamo Plaza San', '<p><span style=\"color:rgb(141,141,141);font-family:Montserrat, sans-serif;font-size:16px;font-style:normal;font-weight:500;background-color:rgb(255,255,255);\">Oscar Eade was born in Colombia and moved to the United States in 2001 at the age of 20, in pursuit of a better future. He initially took a job working at a cafeteria in a Miami hotel. Noticing construction taking off in 2002 he looked for a way into the real estate industry and found work with investors who were purchasing, remodeling, and selling single family homes in the Tampa Bay area. Miguel immediately fell in love with the business, and quickly learned from the investors who became mentors to him. They saw his potential and within a short time he was managing over 150 properties in Tampa Bay, Orlando, and Jacksonville, Florida while becoming a Residential Real Estate Appraiser until opening his own practice. Soon after became very interested in helping families achieve their home dreams and goals <br /></span></p>', NULL, '2025-04-13 19:56:49', '2025-04-14 03:20:20'),
(54, 33, 303, 'Oscar', 'Eade', 'USA', 'Texas', 'San Antonio', '123 Alamo Plaza San', '<p><span style=\"color:rgb(141,141,141);font-family:Montserrat, sans-serif;font-size:16px;font-style:normal;font-weight:500;background-color:rgb(255,255,255);\">Oscar Eade was born in Colombia and moved to the United States in 2001 at the age of 20, in pursuit of a better future. He initially took a job working at a cafeteria in a Miami hotel. Noticing construction taking off in 2002 he looked for a way into the real estate industry and found work with investors who were purchasing, remodeling, and selling single family homes in the Tampa Bay area. Miguel immediately fell in love with the business, and quickly learned from the investors who became mentors to him. They saw his potential and within a short time he was managing over 150 properties in Tampa Bay, Orlando, and Jacksonville, Florida while becoming a Residential Real Estate Appraiser until opening his own practice. Soon after became very interested in helping families achieve their home dreams and goals.</span></p>', NULL, '2025-04-13 19:56:49', '2025-04-14 03:20:20'),
(55, 34, 302, 'Mackenzie', 'Buntine', 'USA', 'v', 'San Antonio', '123 Alamo Plaza San', '<p><span style=\"color:rgb(141,141,141);font-family:Montserrat, sans-serif;font-size:16px;font-style:normal;font-weight:500;background-color:rgb(255,255,255);\">Mackenzie Buntine was born in Colombia and moved to the United States in 2001 at the age of 20, in pursuit of a better future. He initially took a job working at a cafeteria in a Miami hotel. Noticing construction taking off in 2002 he looked for a way into the real estate industry and found work with investors who were purchasing, remodeling, and selling single family homes in the Tampa Bay area. Miguel immediately fell in love with the business, and quickly learned from the investors who became mentors to him. They saw his potential and within a short time he was managing over 150 properties in Tampa Bay, Orlando, and Jacksonville, Florida while becoming a Residential Real Estate Appraiser until opening his own practice. Soon after became very interested in helping families achieve their home dreams and goals for what he became a Sales Associate and then a Top Producer Broker achieving the highest sales award over four consecutive years during his time at Weichert, Realtors - Best Beach. He is now ranked the #1 agent in sales for Century 21 KoRes and a member of Masters Emerald an elite group of high producing professionals for Century 21 in the country. Miguel’s top skills include Spanish/English fluent, quality negotiation skills MCNE (Master Certified Negotiation Expert)</span></p>', NULL, '2025-04-13 19:57:51', '2025-04-14 03:28:01'),
