(63, 38, 300, 'John', 'Doe', 'United Kingdom', 'England', 'London', '45 Queen’s Road', '<p>Jhon has been a licensed Realtor since 1983.  He is one of the Broker/Owners of RE/MAX Professionals, and holds the CRS, GRI, CDPE, and CLHMS Designations which gives him expertise in all aspects of negotiating Residential Real Estate including as a Certified Luxury Home Marketing Specialist.  He is also a CRB Candidate which specializes in Residential Brokerage Administration.</p>', NULL, '2025-04-26 02:11:51', '2025-04-26 03:24:17'),
(64, 38, 301, 'Sarah', 'Wilson', 'United Kingdom', 'England', 'London', '45 Queen’s Road', '<p>ماريا وكيل عقارات مرخص منذ عام 1983. وهو أحد وسطاء/مالكي RE/MAX Professionals، ويحمل شهادات CRS وGRI وCDPE وCLHMS التي تمنحه الخبرة في جميع جوانب التفاوض على العقارات السكنية بما في ذلك كونه أخصائي تسويق منازل فاخرة معتمد. وهو أيضًا مرشح CRB المتخصص في إدارة الوساطة السكنية.</p>', NULL, '2025-04-26 02:11:51', '2025-04-26 03:24:17'),
