(58, 300, 148, 'How do I search for properties on your website?', 'You can use the search bar at the top of the homepage to filter properties by location, price, property type, and more. You can also browse featured listings or use advanced filters for more specific needs.', 1, '2025-04-08 00:21:08', '2025-04-08 00:21:08'),
(59, 300, 148, 'Is there a fee to use your website?', 'No, browsing and searching for properties is completely free. If you\'re looking to list a property, we offer both free and premium listing options.', 2, '2025-04-08 00:21:23', '2025-04-08 00:21:23'),
(60, 300, 148, 'How do I schedule a property visit?', 'On each property page, you\'ll find a \"Schedule a Visit\" or \"Contact Agent\" button. Just fill out your preferred date and time, and the agent will get in touch with you.', 3, '2025-04-08 00:21:37', '2025-04-08 00:21:37'),
(61, 300, 148, 'Can I save properties to view later?', 'Yes! Simply create an account and click the heart icon on any listing to save it to your favorites.', 4, '2025-04-08 00:21:53', '2025-04-08 00:23:26'),
(62, 300, 148, 'Are all listings verified?', 'We make every effort to verify listings and ensure they are accurate and up-to-date. However, we always recommend confirming details with the listing agent or owner.', 5, '2025-04-08 00:22:07', '2025-04-08 00:22:07'),
(63, 300, 148, 'What is the process of buying a home?', 'The typical process involves searching for a property, getting pre-approved for a loan, making an offer, conducting inspections, finalizing paperwork, and closing the deal.', 6, '2025-04-08 00:22:26', '2025-04-08 00:22:26'),
(64, 300, 148, 'Do I need a real estate agent to buy a home?', 'While it\'s not required, working with a licensed agent can help you find the best deals, negotiate terms, and handle the legal aspects of the purchase.', 7, '2025-04-08 00:22:41', '2025-04-08 00:22:41'),
(65, 300, 148, 'How can I find out if a property is still available?', 'Availability is updated regularly, but we recommend contacting the listing agent directly for the most accurate and up-to-date information.', 8, '2025-04-08 00:22:54', '2025-04-08 00:22:54'),
(66, 300, 148, 'How do I list my property on your website?', 'Simply create an account, go to the \"List Your Property\" section, and fill out the form with your property details and images.', 9, '2025-04-08 00:23:53', '2025-04-08 00:23:53'),
