(85, 303, 149, 'كيف أبدأ في شراء عقار عبر موقعكم؟', 'يمكنك البدء بالتصفح حسب الموقع أو السعر، ثم التواصل معنا لحجز موعد زيارة أو استشارة مجانية.', 1, '2025-04-20 23:51:02', '2025-04-20 23:51:02'),
(86, 303, 149, 'هل تقدمون خدمات التمويل العقاري؟', 'نعم، نحن نتعاون مع عدة بنوك وشركات تمويل لمساعدتك في الحصول على أفضل حلول التمويل المناسبة لاحتياجاتك.', 2, '2025-04-20 23:51:15', '2025-04-20 23:51:15'),
(87, 303, 149, 'كم تستغرق عملية شراء أو بيع العقار؟', 'تختلف المدة حسب نوع العقار والإجراءات المطلوبة، لكنها عادة ما تستغرق من أسبوعين إلى شهر تقريباً.', 3, '2025-04-20 23:51:29', '2025-04-20 23:51:29'),
(88, 303, 149, 'هل يمكنني حجز موعد لزيارة العقار؟', 'نعم، يمكنك التواصل معنا لحجز موعد زيارة سواء كان حضورياً أو عبر جولة افتراضية.', 4, '2025-04-20 23:51:41', '2025-04-20 23:51:41'),
(89, 303, 149, 'هل تقدمون خدمات تأجير العقارات؟', 'نعم، نحن نقدم خدمات التأجير للمالكين وكذلك المساعدة للمستأجرين في العثور على العقار المناسب.', 5, '2025-04-20 23:51:57', '2025-04-20 23:51:57'),
(90, 303, 149, 'هل جميع العقارات المعروضة موثوقة ومسجلة؟', 'نحن نتحقق من جميع المستندات ونتأكد من قانونية العقارات قبل عرضها على الموقع، لضمان الشفافية والمصداقية.', 6, '2025-04-20 23:52:16', '2025-04-20 23:52:16'),
(91, 303, 149, 'هل يمكنني الحصول على استشارة مجانية قبل شراء العقار؟', 'نعم، نحن نقدم استشارات مجانية للمساعدة في تحديد احتياجاتك العقارية وتقديم المشورة المناسبة لك.', 7, '2025-04-20 23:52:38', '2025-04-20 23:52:38'),
(92, 303, 149, 'هل تساعدون في بيع العقارات التجارية؟', 'نعم، نقدم خدمات بيع العقارات التجارية بما في ذلك المكاتب والمحلات التجارية والأراضي، ونتعامل مع كل مرحلة من مراحل العملية بكفاءة.', 8, '2025-04-20 23:52:53', '2025-04-20 23:52:53'),
(93, 303, 149, 'هل يمكنني شراء عقار عبر الإنترنت؟', 'نعم، يمكننا ترتيب شراء العقار عبر الإنترنت، بما في ذلك التفاوض على السعر، توقيع العقود، والتعامل مع إجراءات الدفع.', 9, '2025-04-20 23:53:04', '2025-04-20 23:53:04'),
(94, 301, 148, 'كيف أبدأ في شراء عقار عبر موقعكم؟', 'يمكنك البدء بالتصفح حسب الموقع أو السعر، ثم التواصل معنا لحجز موعد زيارة أو استشارة مجانية.', 1, '2025-04-21 00:49:12', '2025-04-21 00:49:12'),
(95, 301, 148, 'هل تقدمون خدمات التمويل العقاري؟', 'نعم، نحن نتعاون مع عدة بنوك وشركات تمويل لمساعدتك في الحصول على أفضل حلول التمويل المناسبة لاحتياجاتك.', 2, '2025-04-21 00:49:27', '2025-04-21 00:49:27'),
