INSERT INTO `user_project_contents` (`id`, `project_id`, `language_id`, `title`, `slug`, `address`, `description`, `meta_keyword`, `meta_description`, `created_at`, `updated_at`) VALUES
(76, 26, 300, 'Crown Jewel Estates', 'crown-jewel-estates', 'Felberstraße 8', '<p>Introducing nearly 5 Acres for sale on Historic Miller Dr in Miami\'s coveted Horse Country. When space &amp; privacy means everything, look no further: Join the elite few &amp; build your legacy in a timeless investment. Miami\'s Horse Country offers the classic allure of the equestrian lifestyle for those searching for balance of privacy &amp; nature. The large lots of Horse Country has seen flourish a behind-the-gates lifestyle of custom estates, mins away from major business districts, highways &amp; schools-- offering peace &amp; private resort living. Currently a successful palm grove nursery, your options are limitless: Build, assemble, subdivide. The vision is yours to build. Land &amp; Location are the Cornerstones of Real Estate Success--Don\'t miss this unique opportunity!</p>\r\n<p>Zoned 4400/multifamily, the city of Opa Locka permits the construction of up to 33 units. Unlock a lucrative development opportunity with this strategically located 1.1-acre commercial lot in close proximity to major amenities. Key highlights include its prime location near the Amazon Warehouse, Executive Airport, and shopping centers, presenting a favorable environment for a dynamic and profitable residential space. This investment opportunity, strategically positioned in a thriving commercial district, is primed for substantial returns. Seize the chance to lead in the area\'s growth. </p>', NULL, NULL, '2025-04-09 23:48:34', '2025-04-09 23:48:34'),
(77, 27, 300, 'Serenity Grand Residences', 'serenity-grand-residences', 'Düsseldorfer Str. 29', '<p>Welcome to the epitome of waterfront luxury living in Miami\'s prestigious Eastern Shores! This stunning 4-Bedroom, 3.5-Bathroom residence offers approximately 3,400 sqft of living space and 90-feet of PRIME waterfront. There are no-fixed bridges and a large dock for up to an 80-foot yacht. This property provides unparalleled access for boat enthusiasts with direct water access and breathtaking views. Inside, discover spacious living areas, 24ft high ceilings throughout, elegant finishes, custom wood and iron work and modern amenities seamlessly integrating indoor-outdoor living. Perfect for entertaining or unwinding in style. Situated in a gated neighborhood minutes to shopping, dining, and entertainment. This is the essence of Miami\'s coveted waterfront lifestyle.</p>\r\n<div class=\"about-this-home\">\r\n<div class=\"ldp-description-text-container truncate-container\">\r\n<p class=\"ldp-description-text\">Rarely available spacious 3 bedroom, 2.5 bathrooms at Sunset Harbour. Tastefully updated and completely turnkey. Enjoy eastern views of Miami Beach from one of 2 balconies from the master bedroom. The spacious master bathroom features a luxurious soaking tub as well as a separate shower.<br /><br />Open kitchen with marble countertop with plenty of room to prepare gourmet meals.<br /><br />The condo has many custom-built features that must be seen. Sunset Harbour Drive is one of the most desirable Miami Beach Neighborhoods, filled with great restaurants, shops and things to do, up for renting a paddle board or going to yoga studio?<br /><br />Sunset Harbour South is a full-service building with many amenities.</p>\r\n</div>\r\n</div>', NULL, NULL, '2025-04-09 23:53:32', '2025-04-09 23:53:32'),
(78, 28, 300, 'Midtown Business Towers', 'midtown-business-towers', 'Kronprinzenstraße 46', '<p><span style=\"font-size:14pt;\">One <strong>Bennett </strong>Park has taken its place among Chicago\'s most elite residences. Designed by Robert A.M. Stern Architects and developed by Related Midwest, this world class building was designed from the top down. Gracing the crown of this iconic lakefront tower, Penthouse 65 is being offered as a fully designed and finished turn-key residence by Robert A.M. Stern Architects and Related\'s accomplished interiors team. This 7,500 SF full floor Penthouse with private elevator access features 12\'6\" ceilings, unrivaled 360-degree views of the city and lake and a 65 foot long outdoor terrace! This graciously appointed residence offers four bedroom suites including a generous primary suite with a private corner library. Gorgeous eat-in kitchen with custom millwork cabinetry and adjacent family room, elegant dining room opening onto your private terrace, expansive living room with custom stone fireplace, dedicated library with wood paneling and custom built-in cabinetry. Unparalleled finishes throughout this magnificent home in the sky. </span></p>\r\n<p><span style=\"font-size:14pt;\">Two parking spaces with valet service included. This Penthouse is also being offered as raw space option or as a fully custom build with the experienced team at Related offering seamless, concierge-level project management and construction services to ensure that your vision comes to life. This space is unlike any offering the city has ever seen! With only 69 total condominium residences, owners at One Bennett Park enjoy personalized 24-hour concierge services, and valet parking in our discreet porte-cochere offering the ultimate in service and privacy. Our full suite of building amenities is unrivaled in Chicago and includes a world-class fitness center, yoga room, pilates studio, salon and massage suite. The inviting 41st floor owner\'s lounge also offers residents a gracious gathering space with beautiful outdoor terraces, lounge area with fireplace, billiards room, private dining and cordial room. The two museum quality art installations in the lobby are a wonderful addition to this exquisitely designed building. This highly anticipated Penthouse residence is available now. Reach out to learn more about this once in a lifetime offering.</span></p>', NULL, NULL, '2025-04-09 23:58:55', '2025-04-09 23:58:55'),
(79, 29, 300, 'Central Plaza Mixed-Use', 'central-plaza-mixed-use', 'Dreihüttenstraße 3', '<p><span style=\"font-size:14pt;\">Make this beautifully updated 2 Bed/ 2 Bath on a quiet, private street in the loop of Chicago Yours! Yes, quiet, hidden and in Chicago\'s Financial District ! Across from Union Station, kiddie corner from the Kennedy Expressway On \\ Off Ramps and steps away to everything our beautiful city has to offer! This northwest corner unit not only gives you the best natural light in the building, it provides less obstruction from surrounding buildings. New Floors ! Freshly painted! Polished marble! New quartz countertops in the kitchen with brand new appliances! Details of light fixtures and hardware make this unit complete and highly desirable! Best part? It has a Split Bedroom floor plan with great closet space ! Parking Additional $30,000!<br /><br />Make this beautifully updated 2 Bed/ 2 Bath on a quiet, private street in the loop of Chicago Yours! Yes, quiet, hidden and in Chicago\'s Financial District ! Across from Union Station, kiddie corner from the Kennedy Expressway On \\ Off Ramps and steps away to everything our beautiful city has to offer! This northwest corner unit not only gives you the best natural light in the building, it provides less obstruction from surrounding buildings. New Floors ! Freshly painted! Polished marble! New quartz countertops in the kitchen with brand new appliances! Details of light fixtures and hardware make this unit complete and highly desirable! Best part? It has a Split Bedroom floor plan with great closet space ! Parking Additional $30,000!</span></p>', NULL, NULL, '2025-04-10 00:09:03', '2025-04-10 00:09:03'),
(80, 30, 300, 'Town Business Tower', 'town-business-tower', 'Ob. Brinkstraße 1, 44141', '<p>This charming condo, nestled in the sought-after Rio Del Ora complex, features 3 bedrooms and 2 full bathrooms with a thoughtful layout that ensures privacy between the rooms. The spacious Mast Bedroom features a generous walk-in closet and a luxurious en-suite bathroom. Residences enjoy access to a pool, gym, spa. Enjoy the scenic river-view walking trail stretching for miles. Adorned with beautiful plantation shutters, brand new double windows, stainless steel appliances, Cori an countertops, fire place and a privet deck. Perfectly located, within walking distance of great restaurants and shopping. Close to everything. Fifteen minutes to the Beach. Gated community with two reserved parking spaces. Close to the 8, 15 and the 5</p>', NULL, NULL, '2025-04-11 20:25:24', '2025-04-26 00:22:51'),
