n the City w/ Multiple Outdoor Seating Areas, Lush Lawn, &amp; Mature Trees… Perfect for Both Intimate Privacy &amp; Large Gatherings. EZ Walk to Old South Pearl, Broadway, Platt Park, &amp; Wash Park. This Exceptional Home Offers a Rare Blend of Historic Allure, Modern Update</span></p>', NULL, NULL, '2025-04-21 20:22:10', '2025-04-21 20:22:10'),
(97, 46, 304, 'Merenity Grand Residences', 'merenity-grand-residences', 'Garki 900110', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:18px;font-style:normal;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Aiscover this Sensational Sunnyside Bungalow, blending turn of the century charm with modern implements to create a curated haven for daily living and respite. Upon entry, the tastefully renovated home with warm, wood-look luxury vinyl plank invites the visitor to admire the architectural nuances throughout the home. The converted porch creates a foyer complete with a sitting area for those wishing to relax while observing the hustle and bustle of life outside. An adjacent living area provides plenty of space to stretch out and unwind with original brick, exposed beams, and directional lighting combining to become a stunning masterpiece. The open dining area creates a dramatic space with its distinct curvature and modern built-ins, lending character to the already rich architecture. The gourmet kitchen featuring eco-conscious countertops and Bosch Built-In appliances including Oven, Microwave, and Countertop Stove, is sure to inspire the home chef. The main level offers a 3/4 bath along with two bedrooms and a laundry nook. Upstairs, the experience continues in the converted attic, where the ceilings and walls follow rooflines for a truly spectacular primary suite. A loft area provides space for an office or reading nook, the full bath en-suite is enhanced with a double vanity, and a private deck allows the user to enjoy fresh air. The fully finished basement offers a living area, bedroom, 3/4 bathroom, a kitchenette with refrigerator and dishwasher, and a second laundry area. Those who enjoy the outdoors will relish the large lot with mature peach tree, and plenty of space for entertaining, alfresco dining, and gardening. A detached 2 car garage sits aside 2 additional spaces, providing ample off-street parking for you and your guests. The benefits continue as the central location provides easy access to public transportation, and amenities such as boutique shopping, renowned restaurants, Mile High Stadium (6 min drive!), and a plethora of other attractions.</span></p>', NULL, NULL, '2025-04-21 20:26:40', '2025-04-21 21:30:04'),
(98, 47, 304, 'Prestige Trade Center', 'prestige-trade-center', '34 Port Harcourt Cres', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Discover this Sensational Sunnyside Bungalow, blending turn of the century charm with modern implements to create a curated haven for daily living and respite. Upon entry, the tastefully renovated home with warm, wood-look luxury vinyl plank invites the visitor to admire the architectural nuances throughout the home. The converted porch creates a foyer complete with a sitting area for those wishing to relax while observing the hustle and bustle of life outside. An adjacent living area provides plenty of space to stretch out and unwind with original brick, exposed beams, and directional lighting combining to become a stunning masterpiece. The open dining area creates a dramatic space with its distinct curvature and modern built-ins, lending character to the already rich architecture. The gourmet kitchen featuring eco-conscious countertops and Bosch Built-In appliances including Oven, Microwave, and Countertop Stove, is sure to inspire the home chef. The main level offers a 3/4 bath along with two bedrooms and a laundry nook. Upstairs, the experience continues in the converted attic, where the ceilings and walls follow rooflines for a truly spectacular primary suite. A loft area provides space for an office or reading nook, the full bath en-suite is enhanced with a double vanity, and a private deck allows the user to enjoy fresh air. The fully finished basement offers a living area, bedroom, 3/4 bathroom, a kitchenette with refrigerator and dishwasher, and a second laundry area. Those who enjoy the outdoors will relish the large lot with mature peach tree, and plenty of space for entertaining, alfresco dining, and gardening. A detached 2 car garage sits aside 2 additional spaces, providing ample off-street parking for you and your guests. The benefits continue as the central location provides easy access to public transportation, and amenities such as boutique shopping, renowned restaurants, Mile High Stadium (6 min drive!), and a plethora of other attractions.</span></p>', NULL, NULL, '2025-04-21 20:31:22', '2025-04-21 20:31:22'),
(99, 48, 304, 'Central Plaza Mixed-Use', 'central-plaza-mixed-use', 'Santa Margarita 2a Secc.', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">With a tasteful blend of classic style and modern updates, this stunning Wash Park bungalow features a newly remodelled kitchen and bathroom along with lighting upgrades in the dining room and living room. Recently showcased on the annual Wash Park Home Tour, this three bedroom, two bathroom house has two original oak builtin cabinets framing the dining room, and hardwood floors throughout the main level. The kitchen has remodelled cabinets, new quartz countertops, modern fixtures, a new subway tile backsplash, and a breakfast nook overlooking the manicured backyard. One of the two large main-floor bedrooms has an adjacent window-filled sunroom perfect for a nursery or office. The finished basement features new carpeting in the ample family room that offers a natural divide providing space for an office, as well as a 3/4 bathroom, non-conforming bedroom, laundry room and storage space in the mechanical room. This well-maintained house has received a new roof, new exterior paint, irrigation system upgrades, and a new fence all within the last ten years (the current owners have lived in the house for twenty years). The front-entry two-car garage offers added security with no alley access and a spring blossom tree-lined driveway, and the flowering pear trees on the south side of the house bring shade in the summer. You won\'t find a more lovingly cared for, charming bungalow on such a friendly,</span></p>', NULL, NULL, '2025-04-21 20:36:58', '2025-04-21 20:36:58'),
(100, 49, 304, 'Serenity Grand Residences', 'serenity-grand-residences', 'De Las Torres 716', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">The location &amp; amenities vs. cost could not be more impressive. The Koda building boasts 24/7 concierge and top of the line security. Within steps of the front entry, you have the light rail, ferries, trains, busses, great food &amp; more. Take in the expansive views from the rooftop deck &amp; wave to the folks on the ferry coming in from across the Sound. To your left, you see the sports stadiums &amp; train stations. Open layout w/floor to ceiling windows in studio is gorgeous. PET FRIENDLY! Use the self-serve wash &amp; take your pup to the indoor dog lounge. Club Koda is perfect for entertaining w/views, kitchen, game room, etc. Gym w/ views, Zen Lounge, theatre room and more! Make sure you check everything out. This is truly a</span></p>\r\n<p> </p>\r\n<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\"><span style=\"color:rgb(0,0,0);font-family:Outfit, sans-serif, sans-serif;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">The location &amp; amenities vs. cost could not be more impressive. The Koda building boasts 24/7 concierge and top of the line security. Within steps of the front entry, you have the light rail, ferries, trains, busses, great food &amp; more. Take in the expa