(101, 50, 304, 'Charming Town Homes', 'charming-town-homes', 'C. Laurel 423A', '<p>This legendary building was once home to some of tech\'s most visionary minds where innovation &amp; creativity thrived. Now, a rare opportunity awaits to own a space defined by incredible volume, 4 distinct outdoor areas, luxury kitchen &amp; bath features, &amp; sweeping skyline views from every angle. Guests are welcomed by a breathtaking 37+/- ft atrium crowned by an 12-ft angled skylight flooding the home with natural light &amp; architectural drama. The remodeled kitchen boasts sleek Leicht motorized cabinetry, waterfall-edge stone island, top-tier appliances, Wolf cooktop, Miele oven, Sub-Zero fridge, dual wine fridges &amp; its own outdoor space with BBQ gas line. At its heart, the expansive living room showcases a marble fireplace against a wall of glass, with automated shades &amp; electric window opener for effortless light &amp; temp control. The open layout flows to a dining area with custom cabinetry. Above, an open office loft leads to the rooftop retreat. Two primary suites offer remodeled en-suite bathrooms with Graff shower fixtures. The entertainer\'s rooftop features a wet bar, fire pit, outdoor heater, hot tub with city views, &amp; south-facing vistas. Additional features: Sonos system, recessed speakers, AC, radiant heat, &amp; 2-car parking. Luxury &amp; design in a one-of-a-kind creative space</p>', NULL, NULL, '2025-04-21 20:52:31', '2025-04-21 20:52:31'),
