(103, 51, 305, 'شقة بأسعار معقولة للعيش', 'شقة-بأسعار-معقولة-للعيش', 'Anáhuac 65', '<p>فيو ريدج، قطعة أرض زاوية واسعة! فيو ريدج من أرقى أحياء سياتل! بمساحة 7900 قدم مربع، تتمتع هذه القطعة بإمكانيات مذهلة! الشقة المكونة من غرفتي نوم وحمامين، بأرضيات مُجددة، جاهزة للسكن الآن! سكن في هذه الشقة ريثما تحصل على مخططات بناء منزل منفصل في الخلف، أو منزل أكبر على قطعة الأرض. البائع على استعداد للالتزام بشروط عقد الإيجار. تم فحص المنزل مسبقًا. لا تنتظر، هذا لن يدوم!<br />فيو ريدج، قطعة أرض زاوية واسعة! فيو ريدج من أرقى أحياء سياتل! بمساحة 7900 قدم مربع، تتمتع هذه القطعة بإمكانيات مذهلة! الشقة المكونة من غرفتي نوم وحمامين، بأرضيات مُجددة، جاهزة للسكن الآن! سكن في هذه الشقة ريثما تحصل على مخططات بناء منزل منفصل في الخلف، أو منزل أكبر على قطعة الأرض. البائع على استعداد للالتزام بشروط عقد الإيجار. تم فحص المنزل مسبقًا. لا تنتظر، هذا لن يدوم!</p>', NULL, NULL, '2025-04-21 21:46:56', '2025-04-21 21:46:56'),
(104, 50, 305, 'منازل تاون هاوس الساحرة', 'منازل-تاون-هاوس-الساحرة', 'C. Laurel 423A', '<p>كان هذا المبنى الأسطوري موطنًا لبعض من أكثر العقول التقنية رؤية حيث ازدهر الابتكار والإبداع. الآن، تنتظرك فرصة نادرة لامتلاك مساحة محددة بحجم لا يصدق، و4 مناطق خارجية مميزة، ومطبخ وحمام فاخر، وإطلالات بانورامية على الأفق من كل زاوية. يتم الترحيب بالضيوف من خلال أتريوم مذهل بمساحة 37 قدمًا مربعًا متوجًا بفتحة سقف بزاوية 12 قدمًا تغمر المنزل بالضوء الطبيعي والدراما المعمارية. يتميز المطبخ الذي تم تجديده بخزائن Leicht الأنيقة الآلية، وجزيرة حجرية بحافة شلال، وأجهزة من الدرجة الأولى، وموقد Wolf، وفرن Miele، وثلاجة Sub-Zero، وثلاجات نبيذ مزدوجة ومساحة خارجية خاصة به مع خط غاز للشواء. في قلبها، تعرض غرفة المعيشة الواسعة مدفأة رخامية مقابل جدار من الزجاج، مع ظلال آلية وفتاحة نوافذ كهربائية للتحكم في الإضاءة ودرجة الحرارة بسهولة. يتدفق التصميم المفتوح إلى منطقة تناول الطعام ذات الخزائن المخصصة. في الأعلى، يؤدي مكتب مفتوح إلى ملاذ على السطح. جناحان رئيسيان بحمامات داخلية مُجددة مع تجهيزات دش من غراف. يتميز سطح الجناح المخصص للترفيه ببار، وحفرة نار، ومدفأة خارجية، وحوض استحمام ساخن مع إطلالات على المدينة، ومناظر جنوبية خلابة. ميزات إضافية: نظام سونوس، ومكبرات صوت مدمجة، وتكييف هواء، وتدفئة مشعة، وموقف سيارات يتسع لسيارتين. فخامة وتصميم فريد في مساحة إبداعية فريدة من نوعها.</p>', NULL, NULL, '2025-04-21 21:48:48', '2025-04-21 21:48:48'),
(105, 49, 305, 'سيرينيتي جراند ريزيدنسز', 'سيرينيتي-جراند-ريزيدنسز', 'De Las Torres 716', '<p>الموقع والمرافق مُقارنةً بالتكلفة لا يُمكن أن يكون أكثر إثارة للإعجاب. يتميز مبنى كودا بخدمة استقبال على مدار الساعة طوال أيام الأسبوع وحراسة أمنية مُتميزة. على بُعد خطوات من المدخل الرئيسي، ستجد القطار الخفيف، والعبارات، والقطارات، والحافلات، وطعامًا شهيًا، وغيرها الكثير. استمتع بالمناظر الخلابة من سطح المبنى، ولوّح لضيوف العبارة القادمين من الجانب الآخر من المضيق. على يسارك، سترى الملاعب الرياضية ومحطات القطار. تصميم الاستوديو المفتوح مع نوافذ ممتدة من الأرض حتى السقف رائع. مُناسب للحيوانات الأليفة! استخدم غسالة الخدمة الذاتية واصطحب جروك إلى صالة الكلاب الداخلية. يُعد نادي كودا مثاليًا للترفيه، مع إطلالات خلابة، ومطبخ، وغرفة ألعاب، وغيرها. يضم النادي صالة ألعاب رياضية مع إطلالات خلابة، وصالة زن، وغرفة مسرح، وغيرها الكثير! تأكد من الاطلاع على كل شيء. إنه حقًا...</p>\r\n<p>الموقع والمرافق مُقارنةً بالتكلفة لا يُمكن أن يكون أكثر إثارة للإعجاب. يتميز مبنى كودا بخدمة استقبال على مدار الساعة طوال أيام الأسبوع وحراسة أمنية مُتميزة. على بُعد خطوات من المدخل الرئيسي، ستجد القطار الخفيف، والعبارات، والقطارات، والحافلات، وطعامًا شهيًا، وغيرها الكثير. استمتع بالمناظر الخلابة من سطح المبنى، ولوّح لضيوف العبارة القادمين من الجانب الآخر من المضيق. على يسارك، ترى الملاعب الرياضية ومحطات القطار. تصميم الاستوديو المفتوح مع نوافذ ممتدة من الأرض حتى السقف رائع. مناسب للحيوانات الأليفة! استخدم مغسلة الخدمة الذاتية، واصطحب جروك إلى صالة الكلاب الداخلية. نادي كودا مثالي للترفيه، مع إطلالات خلابة، ومطبخ، وغرفة ألعاب، وغيرها. صالة ألعاب رياضية مع إطلالات خلابة، وصالة استرخاء، وغرفة مسرح، وغيرها الكثير! تأكد من زيارة كل شيء. إنه حقًا...</p>', NULL, NULL, '2025-04-21 21:51:10', '2025-04-21 21:51:10'),
(106, 32, 303, 'مساكن الواحة الحضرية', 'مساكن-الواحة-الحضرية', 'Av. Ignacio L Vallarta', '<p>مرحبًا بكم في تيكابينج، مساحة عشبية واسعة، مساحة قابلة للتحويل إلى مساحة عشبية واسعة، بمجرد دخولك، تستقبلك غرفة معيشة واسعة مغمورة بضوء طبيعي من نافذة خليجية كبيرة، مما يجعلها المكان المثالي للاسترخاء. يتميز المطبخ بغرف مجهزة بتكييف هواء للأيام الدافئة، مما يضمن مساحة مريحة لجميع مغامراتك في الطهي. تشمل التحديثات الأخيرة في جميع أنحاء المنزل حوض حمام مُجدد ووحدات إضاءة حديثة وأرضيات خشبية جميلة. يعزز الطلاء الجديد والإضاءة المُدمجة الشعور المشرق والمتجدد في جميع الأنحاء.</p>\r\n<p>الفناء الخلفي مجهز بتكييف هواء للأيام الدافئة، مما يضمن مساحة عشبية مريحة، وفناء مثالي لحفلات الشواء في عطلة نهاية الأسبوع أو القهوة الصباحية. ستحب قضاء الوقت في الهواء الطلق في هذه المساحة المُعتنى بها بشكل جميل. يأتي هذا المنزل مُجهزًا بتكييف هواء للأيام الدافئة، مما يضمن الراحة على مدار السنة. يقع في شارع ساحر تصطف على جانبيه الأشجار، مما يجعله قريبًا من حديقة بالبوا، ووسائل النقل، والطرق السريعة، ومجموعة من المطاعم ووجهات التسوق. لا تدع هذا الجمال المشرق يفوتك! منازل مجهزة بتكييف هواء لأيام دافئة، تضمن لك الراحة.</p>', NULL, NULL, '2025-04-21 22:35:27', '2025-04-21 22:35:27'),
(107, 48, 305, 'سنترال بلازا متعدد الاستخدامات', 'سنترال-بلازا-متعدد-الاستخدامات', 'Santa Margarita 2a Secc.', '<p>بمزيج أنيق من الطراز الكلاسيكي والتحديثات الحديثة، يتميز هذا البنغل الرائع في واش بارك بمطبخ وحمام تم تجديدهما حديثًا بالإضافة إلى ترقيات الإضاءة في غرفة الطعام وغرفة المعيشة. عُرض مؤخرًا في جولة واش بارك هوم السنوية، يحتوي هذا المنزل المكون من ثلاث غرف نوم وحمامين على خزانتين مدمجتين من خشب البلوط الأصلي يؤطران غرفة الطعام وأرضيات من الخشب الصلب في جميع أنحاء الطابق الرئيسي. يحتوي المطبخ على خزانات تم تجديدها وأسطح عمل كوارتز جديدة وتركيبات حديثة وبلاط مترو جديد وركن إفطار يطل على الفناء الخلفي المشذب. تحتوي إحدى غرفتي النوم الكبيرتين في الطابق الرئيسي على غرفة شمسية مجاورة مليئة بالنوافذ مثالية لغرفة أطفال أو مكتب. يتميز الطابق السفلي المكتمل بسجاد جديد في غرفة العائلة الواسعة التي توفر تقسيمًا طبيعيًا يوفر مساحة لمكتب، بالإضافة إلى حمام 3/4 وغرفة نوم غير مطابقة وغرفة غسيل ومساحة تخزين في غرفة الميكانيكا. هذا المنزل المُحافظ عليه جيدًا، حصل على سقف جديد، وطلاء خارجي جديد، وتحديثات في نظام الري، وسياج جديد، كل ذلك خلال السنوات العشر الماضية (يعيش الملاك الحاليون في المنزل منذ عشرين عامًا). يوفر مرآب المدخل الأمامي الذي يتسع لسيارتين أمانًا إضافيًا، حيث لا يمكن الوصول إليه عبر زقاق، وممر مُزين بأشجار الربيع المُزهرة، كما تُضفي أشجار الكمثرى المُزهرة على الجانب الجنوبي من المنزل ظلًا في الصيف. لن تجد منزلًا ريفيًا ساحرًا ومُعتنى به أكثر من هذا في مكان ودود كهذا.</p>', NULL, NULL, '2025-04-21 22:39:34', '2025-04-21 22:39:34'),
