(109, 46, 305, 'ميرينيتي جراند ريزيدنسز', 'ميرينيتي-جراند-ريزيدنسز', 'Garki 900110', '<p dir=\"rtl\">اسم المشروع: مشروع الرفاهية السكني<br />الموقع: الرياض، المملكة العربية السعودية<br />نوع العقار: شقق سكنية<br />عدد الوحدات: 120 وحدة<br />الحالة: جاهز للسكن</p>\r\n<p dir=\"rtl\">وصف المشروع:<br />مشروع سكني متكامل يقع في موقع مميز بمدينة الرياض. يتميز بتصميم عصري وتشطيبات فاخرة، ويضم مجموعة متنوعة من الشقق تناسب جميع أفراد العائلة. المشروع محاط بالخدمات الأساسية مثل المدارس، المستشفيات، والمراكز التجارية.</p>\r\n<p dir=\"rtl\">مميزات المشروع:</p>\r\n<ul dir=\"rtl\">\r\n<li>\r\n<p>تشطيبات داخلية عالية الجودة</p>\r\n</li>\r\n<li>\r\n<p>مواقف سيارات خاصة</p>\r\n</li>\r\n<li>\r\n<p>نظام أمني على مدار الساعة</p>\r\n</li>\r\n<li>\r\n<p>مناطق مخصصة للأطفال</p>\r\n</li>\r\n<li>\r\n<p>مساحات خضراء وممرات للمشي</p>\r\n</li>\r\n</ul>', NULL, NULL, '2025-04-21 22:45:11', '2025-04-21 22:45:11'),
(110, 45, 305, 'أبراج الأعمال في ميدتاون', 'أبراج-الأعمال-في-ميدتاون', 'Abiodun Jagun St', '<p dir=\"rtl\">أكيد! إليك <strong>محتوى نصي بسيط (بدون تنسيق)</strong> لمشروع عقاري وهمي باللغة العربية، يمكنك استخدامه في موقع عقارات:</p>\r\n<p dir=\"rtl\"><br />الموقع: الرياض، المملكة العربية السعودية<br />نوع العقار: شقق سكنية<br />عدد الوحدات: 120 وحدة<br />الحالة: جاهز للسكن</p>\r\n<p dir=\"rtl\">وصف المشروع:<br />مشروع سكني متكامل يقع في موقع مميز بمدينة الرياض. يتميز بتصميم عصري وتشطيبات فاخرة، ويضم مجموعة متنوعة من الشقق تناسب جميع أفراد العائلة. المشروع محاط بالخدمات الأساسية مثل المدارس، المستشفيات، والمراكز التجارية.</p>\r\n<p dir=\"rtl\">مميزات المشروع:</p>\r\n<ul dir=\"rtl\">\r\n<li>\r\n<p>تشطيبات داخلية عالية الجودة</p>\r\n</li>\r\n<li>\r\n<p>مواقف سيارات خاصة</p>\r\n</li>\r\n<li>\r\n<p> </p>\r\n</li>\r\n</ul>', NULL, NULL, '2025-04-21 22:47:02', '2025-04-21 22:47:02'),
(111, 44, 305, 'قرية هارموني الحضرية', 'قرية-هارموني-الحضرية', 'Abiodun Jagun St', '<p>يقع في موقع مثالي في حديقة رئيسية، ادخل إلى الأناقة الخالدة مع سحر وحرفية الأمس ووسائل الراحة الحديثة بالإضافة إلى إطلالات على الجبل! صممه &amp; أكمل الطابق الرئيسي. اتجه إلى الطابق العلوي للعثور على غرفتي نوم إضافيتين وحمام آخر مع بعض المساحة المرنة لاستيعاب مطبخ صغير أو منطقة جلوس. ليس هذا هو الطابق الثاني الخاص بك لمزيد من غرف النوم والحمام فحسب، بل إنه مصمم بذكاء أيضًا مع قطعة أرض نادرة تبلغ مساحتها 10000 قدم مربع مع مرآب نادر لثلاث سيارات، هذه هي واحتك في المدينة مع مناطق جلوس خارجية متعددة وحديقة خضراء وأشجار ناضجة ... مثالية لكل من الخصوصية الحميمة والتجمعات الكبيرة. يسهل الوصول سيرًا على الأقدام إلى أولد ساوث بيرل وبرودواي وبلات بارك وواش بارك. يوفر هذا المنزل الاستثنائي مزيجًا نادرًا من الجاذبية التاريخية والتحديث الحديث<br />يقع في موقع مثالي في حديقة رئيسية، ادخل إلى الأناقة الخالدة مع سحر وحرفية الأمس ووسائل الراحة الحديثة بالإضافة إلى إطلالات على الجبل! صممه &amp; أكمل الطابق الرئيسي. اتجه إلى الطابق العلوي للعثور على غرفتي نوم إضافيتين وحمام آخر مع بعض المساحة المرنة لاستيعاب مطبخ صغير أو منطقة جلوس. ليس هذا هو الطابق الثاني الخاص بك لمزيد من غرف النوم والحمام فحسب، بل إنه مصمم بذكاء أيضًا مع قطعة أرض نادرة تبلغ مساحتها 10000 قدم مربع مع مرآب نادر لثلاث سيارات، هذه هي واحتك في المدينة مع مناطق جلوس خارجية متعددة وحديقة خضراء وأشجار ناضجة ... مثالية لكل من الخصوصية الحميمة والتجمعات الكبيرة. يسهل الوصول سيرًا على الأقدام إلى أولد ساوث بيرل وبرودواي وبلات بارك وواش بارك. يوفر هذا المنزل الاستثنائي مزيجًا نادرًا من الجاذبية التاريخية والتحديث الحديث</p>', NULL, NULL, '2025-04-21 22:49:17', '2025-04-21 22:49:17'),
(112, 43, 305, 'أبراج الأعمال في ميدتاون', 'أبراج-الأعمال-في-ميدتاون', 'Av. Abedules 402', '<p>تقع هذه الشقة الساحرة في مجمع ريو ديل أورا السكني الراقي، وتضم 3 غرف نوم وحمامين كاملين بتصميم مدروس يضمن الخصوصية بين الغرف. تتميز غرفة نوم ماست الفسيحة بخزانة ملابس واسعة وحمام داخلي فاخر. يتمتع السكان بإمكانية الوصول إلى مسبح وصالة ألعاب رياضية ومنتجع صحي. استمتع بمسار المشي المطل على النهر الخلاب الممتد لأميال. تتميز الشقة بنوافذ زجاجية جميلة، ونوافذ مزدوجة جديدة كليًا، وأجهزة من الفولاذ المقاوم للصدأ، وأسطح من خشب كوري، ومدفأة، وشرفة خاصة. تتميز الشقة بموقع مثالي، على بُعد مسافة قصيرة سيرًا على الأقدام من المطاعم الرائعة ومراكز التسوق. قريبة من كل شيء. على بُعد 15 دقيقة من الشاطئ. مجمع سكني مسوّر مع موقفين مخصصين للسيارات. قريبة من الطرق 8 و15 و5.</p>\r\n<p>تتميز غرفة نوم ماست الفسيحة بممرات واسعة بتصميم مدروس يضمن الخصوصية بين الغرف. تتميز غرفة نوم ماست الفسيحة بخزانة ملابس واسعة وحمام داخلي فاخر. يتمتع السكان بإمكانية الوصول إلى مسبح وصالة ألعاب رياضية ومنتجع صحي. استمتع بمسار المشي الخلاب المطل على النهر، الممتد لأميال. يتميز بنوافذ مزدوجة جديدة كليًا، وأجهزة من الفولاذ المقاوم للصدأ، وأسطح عمل كوري آن، ومدفأة، وشرفة خاصة. موقع مثالي، على بُعد خطوات من المطاعم الرائعة ومراكز التسوق. قريب من كل شيء. على بُعد خمس عشرة دقيقة من الشاطئ. مجمع سكني مسوّر مع موقفين مخصصين للسيارات. قريب من الطرق السريعة 8 و15 و5.</p>', NULL, NULL, '2025-04-21 22:50:45', '2025-04-21 22:50:45'),
(113, 42, 305, 'كراون جويل إستيتس', 'كراون-جويل-إستيتس', 'Av Inglaterra 4186', '<p>نقدم لكم مساحة تقارب 5 أفدنة للبيع على طريق ميلر التاريخي في منطقة هورس كانتري المرموقة في ميامي. عندما تكون المساحة والخصوصية هما كل شيء، فقد وصلت إلى وجهتك: انضم إلى النخبة وابنِ إرثك في استثمارٍ خالد. تُقدم منطقة هورس كانتري في ميامي سحرًا كلاسيكيًا لأسلوب حياة الفروسية لمن يبحثون عن التوازن بين الخصوصية والطبيعة. شهدت مساحات الأراضي الشاسعة في هورس كانتري ازدهارًا في نمط حياة هادئ من العقارات المُخصصة، على بُعد دقائق من المناطق التجارية الرئيسية والطرق السريعة والمدارس، مما يوفر الهدوء وحياة منتجع خاصة. حاليًا، تُعتبر هذه المنطقة مشتلًا ناجحًا لأشجار النخيل، وخياراتك لا حصر لها: البناء، التجميع، التقسيم. الرؤية بين يديك. الأرض والموقع هما أساس نجاح العقارات - لا تفوت هذه الفرصة الفريدة!</p>\r\n<p>تقع منطقة أوبا لوكا في المنطقة 4400/مجمع سكني متعدد العائلات، وتسمح مدينة أوبا لوكا ببناء ما يصل إلى 33 وحدة. اغتنم فرصة تطوير مربحة مع هذه الأرض التجارية التي تبلغ مساحتها 1.1 فدان بموقع استراتيجي بالقرب من المرافق الرئيسية. من أبرز مميزاته موقعه المتميز بالقرب من مستودع أمازون، ومطار التنفيذيين، ومراكز التسوق، مما يوفر بيئة مثالية لمساحة سكنية حيوية ومربحة. هذه الفرصة الاستثمارية، بموقعها الاستراتيجي في منطقة تجارية مزدهرة، واعدة بعوائد استثمارية مجزية. اغتنم الفرصة لقيادة نمو المنطقة.</p>', NULL, NULL, '2025-04-21 22:52:22', '2025-04-21 22:52:22'),
(114, 41, 305, 'مساكن الواحة الحضرية', 'مساكن-الواحة-الحضرية', 'Av. Ignacio L Vallarta', '<p>مرحبًا بكم في تيكابينج، مساحة عشبية رحبة، مساحة قابلة للتحويل إلى 1126 قدمًا مربعًا، مساحة عشبية رحبة. بمجرد دخولك، تستقبلك غرفة معيشة واسعة مغمورة بضوء طبيعي من نافذة خليجية كبيرة، مما يجعلها المكان المثالي للاسترخاء. يتميز المطبخ بغرف مجهزة بتكييف هواء لتلك الأيام الأكثر دفئًا، مما يضمن مساحة مريحة لجميع مغامراتك في الطهي. تشمل التحديثات الأخيرة في جميع أنحاء المنزل حوض حمام مُجدد ووحدات إضاءة حديثة وأرضيات خشبية جميلة. يعزز الطلاء الجديد والإضاءة الغائرة الشعور المشرق والمتجدد في جميع الأنحاء.</p>\r\n<p>الفناء الخلفي مجهز بتكييف هواء لتلك الأيام الأكثر دفئًا، مما يضمن منطقة عشبية مريحة، وفناء مثالي لحفلات الشواء في عطلة نهاية الأسبوع أو قهوة الصباح. ستحب قضاء الوقت في الهواء الطلق في هذه المساحة الجميلة. يأتي هذا المنزل مجهزًا بتكييف هواء لتلك الأيام الأكثر دفئًا، مما يضمن الراحة على مدار السنة. يقع في شارع ساحر تصطف على جانبيه الأشجار، مما يجعله قريبًا من حديقة بالبوا، ووسائل النقل، والطرق السريعة، ومجموعة من المطاعم ووجهات التسوق. لا تدع هذا الجمال المشرق يفوتك! منازل مجهزة بتكييف هواء لأيام دافئة، تضمن لك الراحة.</p>', NULL, NULL, '2025-04-21 22:53:49', '2025-04-21 22:53:49'),
