(130, 53, 301, 'قرية هارموني الحضرية', 'قرية-هارموني-الحضرية', 'Abiodun Jagun St', '<p>يقع هذا المنزل في موقع مثالي في حديقة مميزة، استمتع بأناقة خالدة مع سحر وحرفية الماضي ووسائل الراحة العصرية، بالإضافة إلى إطلالات خلابة على الجبل! صممه المهندسون المعماريون. استكمل الطابق الرئيسي بغرفة نوم رئيسية. اصعد إلى الطابق العلوي لتجد غرفتي نوم إضافيتين وحمامًا إضافيًا مع مساحة مرنة تتسع لمطبخ صغير أو منطقة جلوس. ليس هذا هو طابقك الثاني فقط لمزيد من غرف النوم والحمام، بل إنه مصمم بذكاء أيضًا مع قطعة أرض نادرة مساحتها 10,000 قدم مربع ومرآب يتسع لثلاث سيارات، وهو نادر جدًا. إنه ملاذك في المدينة مع مناطق جلوس خارجية متعددة، وحديقة خضراء، وأشجار ناضجة... مثالي للخصوصية الحميمة والتجمعات الكبيرة. يسهل الوصول سيرًا على الأقدام إلى أولد ساوث بيرل، وبرودواي، وبلات بارك، وواش بارك. يوفر هذا المنزل الاستثنائي مزيجًا نادرًا من الجاذبية التاريخية والتحديثات العصرية. تكتمل غرفة المعيشة الجافة والطينية في الطابق الرئيسي. اصعد إلى الطابق العلوي لتجد غرفتي نوم إضافيتين وحمامًا إضافيًا مع مساحة مرنة تتسع لمطبخ صغير أو منطقة جلوس. هذا ليس فقط طابقك الثاني لمزيد من غرف النوم والحمام، بل يتميز أيضًا بتصميم أنيق مع...</p>', NULL, NULL, '2025-04-25 23:46:50', '2025-04-25 23:46:50'),
(131, 54, 300, 'Urban Oasis Presidences', 'urban-oasis-presidences', 'Av. Ignacio L Vallarta', '<p>Welcome tcaping, a generous grassy area, rtable 1,126 square fcaping, a generous grassy area,s you step inside, you\'re greeted by a spacious living room bathed in natural light from a large bay window, making it the perfect place to unwind.The kitchen is a standout with iomes equipped with air conditioning for those warmer days, ensuring comfortf space for all your culinary adventures. Recent updates across the home include a refreshed bathroom vanity, modern light fixtures, and beautiful laminate flooring. Fresh paint and recessed lighting enhance the bright and airy feel throughout.<br />The backyard is a omes equipped with air conditioning for those warmer days, ensuring comforterous grassy area, and a perfect patio for those weekend BBQs or morning coffees. You’ll love spending time outdoors in this beautifully manicured space.This home comes equipped with air conditioning for those warmer days, ensuring comfort year-round. Situated on a charming tree-lined street, you\'ll find yourself conveniently close to Balboa Park, transportation, freeways, and a host of restaurants and shopping destinations. Don’t let this light and bright beauty slip away! omes equipped with air conditioning for those warmer days, ensuring comfort</p>', NULL, NULL, '2025-04-25 23:51:30', '2025-04-25 23:52:29'),
(132, 54, 301, 'ساكن الواحة الحضرية', 'ساكن-الواحة-الحضرية', 'Av. Ignacio L Vallarta', '<p>مرحبًا بكم في تيكابينج، مساحة عشبية واسعة، مساحة قابلة للتحويل إلى مساحة عشبية واسعة، بمجرد دخولك، تستقبلك غرفة معيشة واسعة مغمورة بضوء طبيعي من نافذة خليجية كبيرة، مما يجعلها المكان المثالي للاسترخاء. يتميز المطبخ بغرف مجهزة بتكييف هواء للأيام الدافئة، مما يضمن مساحة مريحة لجميع مغامراتك في الطهي. تشمل التحديثات الأخيرة في جميع أنحاء المنزل حوض حمام مُجدد ووحدات إضاءة حديثة وأرضيات خشبية جميلة. يعزز الطلاء الجديد والإضاءة المُدمجة الشعور المشرق والمتجدد في جميع الأنحاء.</p>\r\n<p>الفناء الخلفي مجهز بتكييف هواء للأيام الدافئة، مما يضمن مساحة عشبية مريحة، وفناء مثالي لحفلات الشواء في عطلة نهاية الأسبوع أو القهوة الصباحية. ستحب قضاء الوقت في الهواء الطلق في هذه المساحة المُعتنى بها بشكل جميل. يأتي هذا المنزل مُجهزًا بتكييف هواء للأيام الدافئة، مما يضمن الراحة على مدار السنة. يقع في شارع ساحر تصطف على جانبيه الأشجار، مما يجعله قريبًا من حديقة بالبوا، ووسائل النقل، والطرق السريعة، ومجموعة من المطاعم ووجهات التسوق. لا تدع هذا الجمال المشرق يفوتك! منازل مجهزة بتكييف هواء لأيام دافئة، تضمن لك الراحة.</p>', NULL, NULL, '2025-04-25 23:51:30', '2025-04-25 23:52:37'),
(133, 55, 300, 'Prestige Trade Center', 'prestige-trade-center', '34 Port Harcourt Cres', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Discover this Sensational Sunnyside Bungalow, blending turn of the century charm with modern implements to create a curated haven for daily living and respite. Upon entry, the tastefully renovated home with warm, wood-look luxury vinyl plank invites the visitor to admire the architectural nuances throughout the home. The converted porch creates a foyer complete with a sitting area for those wishing to relax while observing the hustle and bustle of life outside. An adjacent living area provides plenty of space to stretch out and unwind with original brick, exposed beams, and directional lighting combining to become a stunning masterpiece. The open dining area creates a dramatic space with its distinct curvature and modern built-ins, lending character to the already rich architecture. The gourmet kitchen featuring eco-conscious countertops and Bosch Built-In appliances including Oven, Microwave, and Countertop Stove, is sure to inspire the home chef. The main level offers a 3/4 bath along with two bedrooms and a laundry nook. Upstairs, the experience continues in the converted attic, where the ceilings and walls follow rooflines for a truly spectacular primary suite. A loft area provides space for an office or reading nook, the full bath en-suite is enhanced with a double vanity, and a private deck allows the user to enjoy fresh air. The fully finished basement offers a living area, bedroom, 3/4 bathroom, a kitchenette with refrigerator and dishwasher, and a second laundry area. Those who enjoy the outdoors will relish the large lot with mature peach tree, and plenty of space for entertaining, alfresco dining, and gardening. A detached 2 car garage sits aside 2 additional spaces, providing ample off-street parking for you and your guests. The benefits continue as the central location provides easy access to public transportation, and amenities such as boutique shopping, renowned restaurants, Mile High Stadium (6 min drive!), and a plethora of other attractions.</span></p>', NULL, NULL, '2025-04-25 23:55:27', '2025-04-25 23:55:27'),
(134, 55, 301, 'مركز بريستيج التجاري', 'مركز-بريستيج-التجاري', '34 Port Harcourt Cres', '<p><br />الموقع: الرياض، المملكة العربية السعودية<br />نوع العقار: شقق سكنية<br />عدد الوحدات: 120 وحدة<br />الحالة: جاهز للسكن</p>\r\n<p>وصف المشروع:<br />مشروع سكني متكامل يقع في موقع مميز بمدينة الرياض. يتميز بتصميم عصري وتشطيبات فاخرة، ويضم مجموعة متنوعة من الشقق تناسب جميع أفراد العائلة. المشروع محاط بالخدمات الأساسية مثل المدارس، المستشفيات، والمراكز التجارية.</p>\r\n<p>مميزات المشروع:</p>\r\n<ul>\r\n<li>\r\n<p>تشطيبات داخلية عالية الجودة</p>\r\n</li>\r\n<li>\r\n<p>مواقف سيارات خاصة</p>\r\n</li>\r\n<li>\r\n<p>نظام أمني على مدار الساعة</p>\r\n</li>\r\n<li>\r\n<p>مناطق مخصصة للأطفال</p>\r\n</li>\r\n<li>\r\n<p>مساحات خضراء وممرات للمشي</p>\r\n</li>\r\n</ul>\r\n<p> </p>', NULL, NULL, '2025-04-25 23:55:27', '2025-04-25 23:55:27'),
