INSERT INTO `user_property_contents` (`id`, `property_id`, `language_id`, `title`, `slug`, `address`, `description`, `meta_keyword`, `meta_description`, `created_at`, `updated_at`) VALUES
(68, 32, 300, 'White Dream Plaza', 'white-dream-plaza', 'Puerto Vallarta Jalisco, Mexico', '<p>Modern Living in coveted Whittier Heights. Discover this stunning boutique 2022 community of four contemporary homes designed for style, comfort &amp; energy efficiency. Floor plan features an open-concept living &amp; dining area, warm hardwood floors, and a sleek kitchen with stainless steel appliances. Ultra-efficient mini-split systems ensure year-round tranquility. The entry-level includes a bedroom, bath, &amp; bike storage. The luxe top-level primary suite offers a walk-in closet, custom-tiled shower, &amp; private rooftop deck access. EV-ready parking with breeze alley access &amp; no HOA dues make this a rare find. Don\'t miss this opportunity to own a boutique townhome that lives like a stand-alone in a prime Ballard neighborhood. Welcome home.</p>', NULL, NULL, '2025-04-09 19:23:44', '2025-04-09 19:23:44'),
(69, 33, 300, 'Danish Gray Building', 'danish-gray-building', 'C. 16 de Septiembre 590a', '<p>This radiant corner-lot residence offers an exceptional blend of comfort, convenience, and modern living. Situated in a thriving neighborhood, this property is just moments away from the light rail station, bike and walking trails, dog park, and playgrounds. The home\'s strategic location near major highways ensures effortless commuting and quick trips to the city\'s numerous attractions.</p>\r\n<p>The welcoming front porch invites relaxation and neighborly chats, while the Trex deck in the backyard provides a durable and stylish space for outdoor gatherings. The low-maintenance astroturf yard ensures green vistas year-round without the upkeep. An extended garage offers ample storage and parking solutions.?</p>\r\n<p>Step inside to discover a sunlit interior, where abundant natural light accentuates the spacious kitchen/living area. The upper floor hosts all bedrooms along with a conveniently located laundry room, streamlining daily routines. An unfinished basement awaits your personal touch, offering a blank canvas for creativity—be it a home gym, entertainment center, or additional living space.?</p>\r\n<p>Experience the perfect harmony of modern amenities and community charm-your gateway to the best of Denver living.</p>\r\n<p>When visiting the home make sure to check out the fitness park at end of Canosa St as well as the dog park. Access to the Dry Creek trail is a block away and you can access downtown as well as Golden on this trail. There are a few picnic/pocket parks as well as a playground located in the neighborhood. Drive around and take a look!</p>\r\n<p>Following Documents are under the supplements tab: Source of water, Sellers Property Disclosures, Square Footage Disclosure, Soil Report, Plot Plan. **Also, the annual average of utilities for this home for 2024 are under the private remarks fyi.</p>', NULL, NULL, '2025-04-09 19:29:15', '2025-04-09 19:52:50'),
(70, 34, 300, 'Repeating the modern house', 'repeating-the-modern-house', 'C. Francisco Marquez 525', '<p>In a professional context it often happens that private or corporate clients corder a publication to be made and presented with the actual content still not being ready. Think of a news blog that\'s filled with content hourly on the day of going live. However, reviewers tend to be distracted by comprehensible content, say, a random text copied from a newspaper or the internet. The are likely to focus on the text, disregarding the layout and its elements. Besides, random text risks to be unintendedly humorous or offensive, an unacceptable risk in corporate environments. <strong>Lorem ipsum</strong> and its many variants have been employed since the early 1960ies, and quite likely since the sixteenth century.</p>', NULL, NULL, '2025-04-09 20:01:05', '2025-04-22 23:42:38'),
(71, 35, 300, 'Denny Triangle', 'denny-triangle', 'Jerez 501', '<p>Aloha and welcome to Ravenna’s best-kept secret! Tucked on a quiet, tree-linull of feel-good energy. All this, just moments f charm. Inside, sunshine pours through every room—highlighting hardwood flooull of feel-good energy. All this, just moments ft just feel right. Upstairs, a loft and roomy attic are ready for yo eady for your big ideas, and below is a flexible space to play or craft. Fully fenced backyard is the perfect retreat for garden parties, relaxing, or morning coffee serenaded by nature. Whether you\'re a first-time buyer, savvy investor, or just craving that classic Seattle neighborhood vibe—this one is full of feel-good energy. All this, just moments from the light rail, restaurants, cafes, parks, the UW, and so much more. Say hello to your happy place!<br /><br /><br />Aloha and welcome to Ravenna’s best-kept secret! Tucked on a quiet, tree-lined street, this home is bursting with charm. Inside, sunshine pours through every room—highlighting hardwood floors, chic designer touches, and warm spaces that just feel right. Upstairs, a loft aull of feel-good energy. All this, just moments fady for your big ideas, and below is a flexible space to plaull of feel-good energy. All this, just moments f s the perfect retreat for garden parties, relaxing, or morning coffee serenaded by nature. Whether you\'re a first-time buyer, savvy investor, or just craving that classic Seattle neighborhood vibe—this one is full of feel-good energy. All this, just moments from the light rail, restaurants, cafes, parks, the UW, and so much more. Say hello to your happy place!</p>', NULL, NULL, '2025-04-09 20:11:57', '2025-04-09 20:11:57'),
(72, 36, 300, 'Luxury Condo with Stunning City Views', 'luxury-condo-with-stunning-city-views', 'Hans-Jürgen Schleifenbaum', '<p>Discover refined living in Gun Club Green, a gated and hig hlyhis custom home offers the perfect blend of privacy, luxury,ivate park, resort-style pool, tennis, and pickleball courts. This cuhis custom home offers the perfect blend of privacy, luxury,uare feet of light and bright, functional living space and is one of the few properties in the neighborhood with a rarely available three-car garage. Step inside to soaring ceilings, an open loft, andhis custom home offers the perfect blend of privacy, luxury, ural light. The main floor is designed for both effortless entertaining and everyday comfort, featuring a gourmet-style kitchen with ample cabinetry, a butler\'s pantry, and seamless flow into the formal dining room and cozy family room with a gas fireplace. A dedicated his custom home offers the perfect blend of privacy, luxury, e setup, while the sunlit deck invites outdoor living overlooking a professionally landscaped, terraced backyard. Upstairs, retreat to a luxurious primary suite with skylights, a private seating area, a five-piece bath with a jetted tub, and a spacious walk-in closet. A bright loft walhis custom home offers the perfect blend of privacy, luxury,e finished basement is a bonus haven with a large rec room, full wet bar, and fourth bedroom with a 3/4 full bath and great extra storage—ideal for hosting or multi-generational living. A Culligan water system is included. Located just minutes from Cherry Creek, Whole Foods, Light Rail, and major highways, this custom home offers the perfect blend of privacy, luxury, and convenience. Don\'t miss your chance to own in one of Denver\'s best-kept secrets—Showings begin 4/18/2025</p>', NULL, NULL, '2025-04-11 20:04:52', '2025-04-11 20:04:52'),
(73, 37, 300, 'Elegant Sconces Apartment with Natural Light', 'elegant-sconces-apartment-with-natural-light', 'Kleppingstraße 8,', '<p>Live the beach lifestyle in this beautiful townhome in the heart of Crown Point. One short block to Mission Bay and Crown Point Park. Enjoy everything that Mission Bay has to offer including the boardwalk, the beach, and the park. This townhome features a private outdoor patio and an oversized 1 car garage. Located in a small 3 unit complex with a low HOA. 1 full bedroom and bathroom downstairs and one bedroom and bathroom upstairs.</p>\r\n<p>Live the beach lifestyle in this beautiful townhome in the heart of Crown Point. One short block to Mission Bay and Crown Point Park. Enjoy everything that Mission Bay has to offer including the boardwalk, the beach, and the park. This townhome features a private outdoor patio and an oversized 1 car garage. Located in a small 3 unit complex with a low HOA. 1 full bedroom and bathroom downstairs and one bedroom and bathroom upstairs.</p>', NULL, NULL, '2025-04-11 20:12:36', '2025-04-27 20:34:50'),
