(75, 39, 302, 'Blues Modern House', 'blues-modern-house', 'Calle Garibaldi 130', '<div class=\"about-this-home\">\r\n<div class=\"ldp-description-text-container truncate-container\">\r\n<p class=\"ldp-description-text\">This radiant corner-lot residence offers an exceptional blend of comfort, convenience, and modern living. Situated in a thriving neighborhood, this property is just moments away from the light rail station, bike and walking trails, dog park, and playgrounds. The home\'s strategic location near major highways ensures effortless commuting and quick trips to the city\'s numerous attractions.<br /><br />The welcoming front porch invites relaxation and neighborly chats, while the Trex deck in the backyard provides a durable and stylish space for outdoor gatherings. The low-maintenance astroturf yard ensures green vistas year-round without the upkeep. An extended garage offers ample storage and parking solutions.?<br /><br />Step inside to discover a sunlit interior, where abundant natural light accentuates the spacious kitchen/living area. The upper floor hosts all bedrooms along with a conveniently located laundry room, streamlining daily routines. An unfinished basement awaits your personal touch, offering a blank canvas for creativity—be it a home gym, entertainment center, or additional living space.?<br /><br />Experience the perfect harmony of modern amenities and community charm-your gateway to the best of Denver living.<br /><br />When visiting the home make sure to check out the fitness park at end of Canosa St as well as the dog park. Access to the Dry Creek trail is a block away and you can access downtown as well as Golden on this trail. There are a few picnic/pocket parks as well as a playground located in the neighborhood. Drive around and take a look!<br /><br />Following Documents are under the supplements tab: Source of water, Sellers Property Disclosures, Square Footage Disclosure, Soil Report, Plot Plan. **Also, the annual average of utilities for this home for 2024 are under the private remarks fyi.</p>\r\n</div>\r\n</div>', NULL, NULL, '2025-04-13 00:43:11', '2025-04-13 00:43:11'),
