(77, 41, 302, 'White Dream Plaza', 'white-dream-plaza', 'C. Gigantes 3010', '<p><span style=\"font-size:14pt;\">MAKE YOUR APPOINTMENT TO SEE THIS BEAUTIFUL UPDATED FRAME SINGLE FAMILY HOME, THIS YOUR NEXT HOME WAS UPDATED WITH RE-SURFACED HARDWOOD FLOORS THROUGH OUT THE HOME. THE KITCHEN WAS UPGRADED WITH STYLISH BLUE KITCHEN CABINETS AND GRANITE COUNTERTOP. THE BATHROOM WAS UPGRADED WITH EYE CATCHING CERAMIC TONES AND NEW VANITIES. THIS HOME HAS A FORMAL DINING ROOM AND PLENTY OF STORAGE SPACE. THE FULL WALK OUT BASEMENT IS WAITING FOR YOUR CREATIVE IDEAS. TWO CAR PARKING SPACES ON THE REAR. THE PROPERTY HAS BEEN PROFESSIONALLY PAINTED AND IN MOVE IN CONDITIONS.</span></p>', NULL, NULL, '2025-04-13 01:29:50', '2025-04-13 01:29:50'),
(78, 42, 302, 'Renovated House with Contemporary Features', 'renovated-house-with-contemporary-features', 'Av. Los Pinos 424', '<p><span style=\"color:rgb(0,0,0);font-family:tahoma, arial, helvetica, sans-serif;font-size:12pt;font-style:normal;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Welcome to Residence 722 - A Modern Urban Retreat with Stunning City Views. Step into this bright and airy condo, where contemporary design meets effortless convenience. Expansive windows bathe the space in natural light, highlighting the soaring ceilings, elegant wood floors, and thoughtful finishes throughout. The full-size galley kitchen is a chef\'s delight, offering ample counter space and abundant storage. The oversized bedroom boasts a striking wall of windows and a spacious walk-in closet, with plenty of room for a work-from-home setup. Located in the sought-after Museum Parc, this secure building features 24-hour front desk service, package management with an Amazon room, and direct elevator access to parking (available). Enjoy exclusive access to on-site Crunch Fitness and a heated outdoor pool (membership required). Unparalleled walkability places you steps from renowned restaurants, shopping, and entertainment. Just two blocks to Whole Foods and Trader Joe\'s on 4th St, with seamless access to 101/280 freeways, Muni Bus &amp; T-Line, Caltrain, and BART. Situated near top tech campuses, including Google, Meta, Salesforce, Amazon, and Microsoft. This exceptional opportunity is offered by a 1031 seller. Plan your visit and experience the best of city living!</span></p>', NULL, NULL, '2025-04-13 20:06:15', '2025-04-13 20:06:15'),
