(91, 32, 301, 'وايت دريم بلازا', 'وايت-دريم-بلازا', 'بويرتو فالارتا خاليسكو، المكسيك', '<p>حياة عصرية في ويتير هايتس الراقية. اكتشف هذا المجمع السكني الرائع، المصمم لعام ٢٠٢٢، والمكون من أربعة منازل عصرية مصممة للأناقة والراحة وكفاءة الطاقة. يتميز تصميم الطابق الأرضي بمساحة معيشة وطعام مفتوحة، وأرضيات خشبية دافئة، ومطبخ أنيق مزود بأجهزة من الفولاذ المقاوم للصدأ. تضمن أنظمة تكييف الهواء المنفصلة فائقة الكفاءة الهدوء على مدار العام. يضم الطابق الأول غرفة نوم وحمامًا ومخزنًا للدراجات. يوفر الجناح الرئيسي الفاخر في الطابق العلوي خزانة ملابس واسعة، ودشًا مبلطًا حسب الطلب، وشرفة خاصة على السطح. مواقف سيارات جاهزة للسيارات الكهربائية مع إمكانية الوصول إلى ممرات المشاة، وإعفاء من رسوم اتحاد مالكي العقارات، مما يجعل هذا المجمع السكني فرصة نادرة. لا تفوت هذه الفرصة لامتلاك تاون هاوس بوتيكي مستقل في حي بالارد الراقي. أهلاً بك في منزلك.</p>\r\n<p>حياة عصرية في ويتير هايتس الراقية. اكتشف هذا المجمع السكني الرائع، المصمم لعام ٢٠٢٢، والمكون من أربعة منازل عصرية مصممة للأناقة والراحة وكفاءة الطاقة. يتميز تصميم الطابق الأرضي بمساحة معيشة وطعام مفتوحة، وأرضيات خشبية دافئة، ومطبخ أنيق مزود بأجهزة من الفولاذ المقاوم للصدأ. تضمن أنظمة تكييف الهواء المنفصلة فائقة الكفاءة الهدوء على مدار العام. يضم الطابق الأول غرفة نوم وحمامًا ومخزنًا للدراجات. يوفر الجناح الرئيسي الفاخر في الطابق العلوي خزانة ملابس واسعة، ودشًا مبلطًا حسب الطلب، وشرفة خاصة على السطح. مواقف سيارات جاهزة للسيارات الكهربائية مع إمكانية الوصول إلى ممرات المشاة، وإعفاء من رسوم اتحاد مالكي العقارات، مما يجعل هذا المجمع السكني فرصة نادرة. لا تفوت هذه الفرصة لامتلاك تاون هاوس بوتيكي مستقل في حي بالارد الراقي. أهلاً بك في منزلك.</p>', NULL, NULL, '2025-04-22 23:50:50', '2025-04-22 23:50:50'),
(92, 48, 303, 'شقة فاخرة بتشطيبات فاخرة', 'شقة-فاخرة-بتشطيبات-فاخرة', 'ج. بانفيلو بيريز 449', '<p>أهلاً بكم في منزلكم! يتميز هذا المنزل الرائع المصمم على طراز المزرعة بمساحة ١٦٨٠ قدم مربع في الطابق العلوي و١١٢٠ قدم مربع في الطابق السفلي المُجهز، وأرضيات خشبية مُجددة بشكل جميل في جميع الأنحاء، ومطبخ دافئ وجذاب مع منطقة جلوس ومدفأة تعمل بالحطب، وثلاجة جديدة، وثلاجة مشروبات جديدة، وأسطح عمل من مادة كوريان، وجزيرة في المنتصف مع موقد طبخ جديد، وغرفة معيشة واسعة ومنطقة لتناول الطعام، وإضاءة جديدة بالكامل، وحمام كامل مُجدد وغرفتي نوم كبيرتين في الطابق العلوي، ويحتوي الجناح الرئيسي الهادئ على حمام داخلي ¾. يحتوي الطابق السفلي على مطبخ/منطقة حرفية، وغرفة نوم أخرى غير مطابقة للمواصفات أو مساحة مرنة، وغرفة عائلية كبيرة. توجد غرفة الغسيل في الطابق السفلي، وتشمل الغسالة والمجفف الجديدين، وغلاية مياه ساخنة جديدة عند الطلب لتسخين المياه. يوجد سقف جديد مع ضمان قابل للتحويل، والفناء الكبير الجميل مثالي للاسترخاء والترفيه. يقع في موقع مركزي يسهل الوصول إليه من مراكز التسوق ويقع في منطقة مدرسة سلافن الابتدائية.</p>', NULL, NULL, '2025-04-25 19:23:49', '2025-04-25 19:23:49'),
(93, 49, 300, 'High-End Condo with Premium Finishes', 'high-end-condo-with-premium-finishes', 'C. Pánfilo Pérez 449', '<p><span style=\"color:rgb(0,0,0);font-family:Outfit, sans-serif, sans-serif;font-size:18px;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Welcome Home! This fabulous ranch style home features 1,680 sf up and 1,120 sf in the finished basement, beautifully refinished hardwood flooring throughout, warm inviting kitchen w/sitting area and woodburning fireplace, new refrigerator, new beverage fridge, Corian counters, center island with new cooktop, large living room and dining area, all new lighting, updated full bath and two large bedrooms up, the tranquil master suite has an ensuite 3/4 bathroom. The basement has a kitchen/craft area, another non-conforming bedroom or flex space and a large family room. The laundry is in the basement, the new washer and dryer are included, a new on-demand hot water boiler for hot water heat. There is a new roof with a transferable warranty and the lovely oversized patio is great for relaxing and entertaining. Centrally located within easy access to shopping and in the Slaven\'s Elementary School District.</span></p>', NULL, NULL, '2025-04-25 19:24:10', '2025-04-25 19:24:10'),
