(98, 51, 300, 'Blues Modern House', 'blues-modern-house', 'Huertas 412', '<p><span style=\"color:rgb(0,0,0);font-family:arial, helvetica, sans-serif;font-size:12pt;font-style:normal;font-weight:200;letter-spacing:0.45px;text-indent:0px;text-transform:none;word-spacing:0px;white-space:normal;text-decoration-thickness:initial;text-decoration-style:initial;float:none;\">Look no more! Why wait when you can move right into this TASTEFULLY REMODELED 2-bedroom home, where charm meets modern comfort! The highly updated interior boasts a fresh neutral palette, new recessed lighting, abundant natural light, and new wood-look tile flooring throughout for easy maintenance. With floor vents in every room, this gem ensures year-round comfort. The open-concept living &amp; dining area provides a seamless flow for everyday living and entertaining. The renewed kitchen features sleek quartz counters, a subway tile backsplash, wood cabinetry, and included appliances—designed for both functionality and style. You\'ll love the large main bedroom, with an entry that can serve as a home office or sitting area! It also includes a walk-in closet and a pristine ensuite with dual sinks. Both primary and secondary bathrooms have been updated for a contemporary feel. Check out the spacious backyard, an ideal retreat complete with an open patio for relaxing or BBQ gatherings! PLUS! You have a storage shed to keep tools organized, along with a versatile workshop that can be easily converted into a guest quarter. The detached 2-car garage is complemented by additional parking spaces beside it. Located in a prime area, this home offers easy access to schools, shopping, restaurants, parks, entertainment, and major highways. Don\'t miss out on this exceptional property!</span></p>', NULL, NULL, '2025-04-25 19:51:53', '2025-04-25 19:51:53');
